import React, { Component } from 'react';

import Toolbar from './Toolbar/Toolbar';
import ButtonTop from './ButtonTop/ButtonTop';
import Footer from './Footer/Footer';

class Layout extends Component {
    render () {
        return (
            <Aux>
                <Toolbar/>
                <main>
                    {this.props.children}
                </main>
                <ButtonTop />
                <Footer />
            </Aux>
        )
    }
};

export default Layout;
